// src/components/WelcomeScreen.js

import React from 'react';

const WelcomeScreen = ({ currentUser, onClose, stats }) => {
  const currentDate = new Date().toLocaleDateString('es-CL', {
    weekday: 'long',
    year: 'numeric',
    month: 'long',
    day: 'numeric'
  });

  const currentTime = new Date().toLocaleTimeString('es-CL', {
    hour: '2-digit',
    minute: '2-digit'
  });

  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      minHeight: 'calc(100vh - 120px)',
      padding: '40px 20px',
      animation: 'fadeIn 0.5s ease-in'
    }}>
      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(-20px); }
            to { opacity: 1; transform: translateY(0); }
          }
          
          @keyframes pulse {
            0% { transform: scale(1); }
            50% { transform: scale(1.05); }
            100% { transform: scale(1); }
          }
          
          @keyframes float {
            0% { transform: translateY(0px); }
            50% { transform: translateY(-10px); }
            100% { transform: translateY(0px); }
          }
        `}
      </style>

      {/* Logo Container */}
      <div style={{
        marginBottom: '40px',
        animation: 'float 3s ease-in-out infinite'
      }}>
        <div style={{
          width: '180px',
          height: '180px',
          borderRadius: '50%',
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          boxShadow: '0 20px 40px rgba(102, 126, 234, 0.3)',
          position: 'relative',
          overflow: 'hidden'
        }}>
          {/* Aqu√≠ puedes poner tu logo */}
          {/* Opci√≥n 1: Imagen desde URL */}
          {/* <img 
            src="URL_DE_TU_LOGO_AQUI" 
            alt="Logo Municipalidad" 
            style={{
              width: '140px',
              height: '140px',
              objectFit: 'contain'
            }}
          /> */}
          
          {/* Opci√≥n 2: Emoji/Icono temporal */}
          <span style={{
            fontSize: '80px',
            color: 'white',
            filter: 'drop-shadow(0 4px 8px rgba(0,0,0,0.2))'
          }}>
            üèõÔ∏è
          </span>
          
          {/* Efecto de brillo */}
          <div style={{
            position: 'absolute',
            top: '-50%',
            left: '-50%',
            width: '200%',
            height: '200%',
            background: 'linear-gradient(45deg, transparent 30%, rgba(255,255,255,0.1) 50%, transparent 70%)',
            transform: 'rotate(45deg)',
            animation: 'shine 3s infinite'
          }} />
        </div>
      </div>

      {/* Mensaje de bienvenida */}
      <h1 style={{
        margin: '0 0 10px 0',
        fontSize: '36px',
        fontWeight: '700',
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        WebkitBackgroundClip: 'text',
        WebkitTextFillColor: 'transparent',
        textAlign: 'center'
      }}>
        ¬°Bienvenido, {currentUser?.name || 'Super Administrador'}!
      </h1>

      <p style={{
        margin: '0 0 30px 0',
        fontSize: '18px',
        color: '#6b7280',
        textAlign: 'center'
      }}>
        Sistema de Gesti√≥n Municipal - Panel de Control
      </p>

      {/* Fecha y hora */}
      <div style={{
        background: 'white',
        padding: '15px 30px',
        borderRadius: '12px',
        boxShadow: '0 4px 20px rgba(0,0,0,0.08)',
        marginBottom: '40px',
        textAlign: 'center'
      }}>
        <div style={{
          fontSize: '16px',
          color: '#374151',
          fontWeight: '500',
          marginBottom: '5px'
        }}>
          {currentDate}
        </div>
        <div style={{
          fontSize: '24px',
          color: '#1f2937',
          fontWeight: '600'
        }}>
          {currentTime}
        </div>
      </div>

      {/* Estad√≠sticas r√°pidas */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
        gap: '20px',
        width: '100%',
        maxWidth: '800px',
        marginBottom: '40px'
      }}>
        <div style={{
          background: 'white',
          padding: '25px',
          borderRadius: '12px',
          boxShadow: '0 4px 20px rgba(0,0,0,0.08)',
          textAlign: 'center',
          transition: 'transform 0.3s ease',
          cursor: 'pointer'
        }}
        onMouseEnter={(e) => e.currentTarget.style.transform = 'translateY(-5px)'}
        onMouseLeave={(e) => e.currentTarget.style.transform = 'translateY(0)'}
        >
          <div style={{ fontSize: '36px', marginBottom: '10px' }}>üë•</div>
          <div style={{ fontSize: '32px', fontWeight: 'bold', color: '#667eea' }}>
            {stats?.totalUsers || 0}
          </div>
          <div style={{ fontSize: '14px', color: '#6b7280' }}>Usuarios Totales</div>
        </div>

        <div style={{
          background: 'white',
          padding: '25px',
          borderRadius: '12px',
          boxShadow: '0 4px 20px rgba(0,0,0,0.08)',
          textAlign: 'center',
          transition: 'transform 0.3s ease',
          cursor: 'pointer'
        }}
        onMouseEnter={(e) => e.currentTarget.style.transform = 'translateY(-5px)'}
        onMouseLeave={(e) => e.currentTarget.style.transform = 'translateY(0)'}
        >
          <div style={{ fontSize: '36px', marginBottom: '10px' }}>üöõ</div>
          <div style={{ fontSize: '32px', fontWeight: 'bold', color: '#764ba2' }}>
            {stats?.totalVehicles || 0}
          </div>
          <div style={{ fontSize: '14px', color: '#6b7280' }}>Veh√≠culos Registrados</div>
        </div>

        <div style={{
          background: 'white',
          padding: '25px',
          borderRadius: '12px',
          boxShadow: '0 4px 20px rgba(0,0,0,0.08)',
          textAlign: 'center',
          transition: 'transform 0.3s ease',
          cursor: 'pointer'
        }}
        onMouseEnter={(e) => e.currentTarget.style.transform = 'translateY(-5px)'}
        onMouseLeave={(e) => e.currentTarget.style.transform = 'translateY(0)'}
        >
          <div style={{ fontSize: '36px', marginBottom: '10px' }}>üìã</div>
          <div style={{ fontSize: '32px', fontWeight: 'bold', color: '#22c55e' }}>
            {stats?.pendingSolicitudes || 0}
          </div>
          <div style={{ fontSize: '14px', color: '#6b7280' }}>Solicitudes Pendientes</div>
        </div>
      </div>

      {/* Acciones r√°pidas */}
      <div style={{
        display: 'flex',
        gap: '15px',
        flexWrap: 'wrap',
        justifyContent: 'center'
      }}>
        <button
          onClick={onClose}
          style={{
            padding: '14px 32px',
            background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
            color: 'white',
            border: 'none',
            borderRadius: '8px',
            fontSize: '16px',
            fontWeight: '600',
            cursor: 'pointer',
            transition: 'all 0.3s ease',
            boxShadow: '0 4px 15px rgba(102, 126, 234, 0.3)',
            animation: 'pulse 2s infinite'
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.transform = 'scale(1.05)';
            e.currentTarget.style.boxShadow = '0 6px 20px rgba(102, 126, 234, 0.4)';
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.transform = 'scale(1)';
            e.currentTarget.style.boxShadow = '0 4px 15px rgba(102, 126, 234, 0.3)';
          }}
        >
          üöÄ Comenzar a Trabajar
        </button>
      </div>

      {/* Mensaje motivacional */}
      <p style={{
        marginTop: '40px',
        fontSize: '14px',
        color: '#9ca3af',
        textAlign: 'center',
        fontStyle: 'italic'
      }}>
        "Construyendo un mejor servicio para nuestra comunidad"
      </p>
    </div>
  );
};

export default WelcomeScreen;
